(1, , 'Scuola Normale Superiore', 'Scuola Normale Superiore eshte nje institut publik per arsimin e larte me karakteristika unike: perzgjedhja e studenteve bazuar ne ekskluzivisht ne merite, mesime mbi baza seminari, mesimdhenie dhe hulumtime thellesisht te nderthurura, nje jete e integruar kolegji dhe nxitja e shkembimeve nderkombetare bazuar ne me te miren evropiane modeli i arsimit te larte. Ne Pize, pedagoge, studiues dhe studente banojne ne te njejtat hapesira, me aktivitete mesimore dhe laboratorike, ngjarje kulturore dhe nisma eksperimentale te gjitha qe ndodhin ne nje zone te vetme. Dy lloje te kurseve jane ne dispozicion: kursi universitar dhe kursi i doktorates. Aktiviteti mesimor eshte shperndare midis tre strukturave akademike: Fakulteti i Shkencave Humane, Fakulteti i Shkencave Matematike dhe Natyrore dhe, nga viti akademik 2014/2015 e tutje, vetem per kursin e doktorates, Instituti i Shkencave Humane dhe Shkencave Sociale, me seli ne Palazzo Strozzi ne Firence. Burimi i shkelqyeshem i Scuola Normale eshte cilesia e studenteve te saj. Te zgjedhur mbi bazen e merites permes nje provimi te posaÃ§em, ata jetojne ne nje sistem krejtesisht falas te kolegjit dhe ndjekin nje kurs studimesh qe rrotullohen rreth nje perzierjeje natyrore te pervojes, kerkimit, studimit te thelluar dhe momenteve te intuites. <br><br><br> Me shume informata: <a target=\"_blank\" href=\"https://www.sns.it/\">Faqja Kryesore</a>', 1, 'universiteti.php', 'Mesoni me shume');
INSERT INTO `universitetet_ue` (`universitetet_uni_ue_ID`, `foto_uni_ue`, `universiteti_uni_ue`, `pershkrimi_uni_ue`, `lokacioni_uni_ue_ID`, `butoni_uni_ue`, `emribut_uni_ue`) VALUES
(2, , 'University of Crete', 'Universiteti i Kretes eshte nje institucion i ri dhe dinamik akademik i perkushtuar per persosmeri ne kerkime dhe mesimdhenie. Universiteti eshte themeluar ne 1973 dhe pranoi studentet e tij te pare ne vitet 1977-78. Tani ka 17 departamente ne 5 fakultete: Filozofi, Arsim, Shkenca Sociale, Shkenca & Inxhinieri, dhe Mjekesi. Aktualisht me shume se 2,000 studente pasuniversitare studiojne ketu, te mesuar nga nje fakultet i jashtem dhe stafi mbeshtetes i mbi 630 me pervoje ne institucionet e arsimit te larte ne te gjithe boten. Universiteti ofron mbi 36 programe master ne lende, duke filluar nga Studime Bizantine deri ne Biologji Molekulare dhe Doktorata ne te gjitha fushat e ekspertizes kerkimore te Universitetit. Studentet e hulumtimit perfitojne gjithashtu nga bashkepunimi i ngushte midis Universitetit te Kretes dhe Fondacionit per Kerkim dhe Teknologji - Hellas (FORTH). Orientimi nderkombetar i Universitetit pasqyrohet ne historine e bashkepunimit me shume prej organizatave kryesore kerkimore dhe arsimore ne Evrope dhe nga mundesite qe u ofrohen studenteve dhe stafit permes pjesemarrjes aktive te tij ne programet e levizshmerise dhe shkembimit. <br><br> Me shume Informata:<a target=\"_blank\" href=\"hhttp://www.en.uoc.gr/\">Faqja Kryesore</a>', 4, 'universiteti.php', 'Mesoni me shume');
INSERT INTO `universitetet_ue` (`universitetet_uni_ue_ID`, `foto_uni_ue`, `universiteti_uni_ue`, `pershkrimi_uni_ue`, `lokacioni_uni_ue_ID`, `butoni_uni_ue`, `emribut_uni_ue`) VALUES
(3, , 'Free University of Berlin', 'Universiteti i Lire i Berlinit eshte themeluar ne vitin 1948 nga studentet dhe profesoret. Nisma ishte per te perfshire nje universitet falas dhe u mbeshtet fuqimisht nga masa dhe fitoi shume ndihme financiare. Aktualisht, universiteti ka 11 departamente akademike, kater institute qendrore shume-disiplinore dhe nje shkolle te shkrire mjekesore me Universitetin Humboldt te Berlinit. Universiteti mban anetaresi te organizatave te ndryshme prestigjioze nderkombetare dhe kombetare si Shoqata Evropiane e Universiteteve (EUA) dhe Rrjeti i Universiteteve nga Kryeqytetet e Evropes (UNICA).  Universiteti i Lire i Berlinit ka kater kampuse kryesore. E vendosur ne jug-perendim te Berlinit, Dahlem Campus eshte shtepia e disa departamenteve si shkencat humane, shkencat shoqerore, historia, ligji, biznesi, ekonomia, shkencat politike, biologjia, kimia dhe fizika. Kampusi gjithashtu strehon 106 ari te medha Kopshti Botanik dhe Instituti John F. Kennedy per Studime te Amerikes se Veriut. Kampusi Lankwitz perfshin Institutin e Shkencave Gjeografike, Institutin e Meteorologjise, Institutin e Shkencave Gjeologjike dhe Institutin e Shkencave Hapesinore. Kampusi gjithashtu ka arkiva universitare. Campus DÃ¼ppel strehon pjesen me te madhe te departamenteve ndihmese te Departamentit te Mjekesise Veterinare. E vendosur ne Steglitz, Benjamin Franklin Campus eshte departamenti i mjekesise se bashkuar te Universitetit Humboldt te Berlinit dhe Universitetit te Lire te Berlinit.  Universiteti ofron 52 programe doktorature, 105 te diplomuar dhe 73 programe te gradave universitare ne fusha te ndryshme si shkencat shoqerore, biologji, kimi, fizike, kimi, mjekesi, farmaci, matematike, gjuhe, studime kulturore, juridik, ekonomi, biznes dhe arte. Universiteti eshte shtepi per mbi 37,000 studente dhe mbi 4,400 anetare te stafit. Ai llogaritet ne universitetet me te larta nderkombetare per popullsine e larte te studenteve dhe mesuesve nderkombetare. Universiteti gjithashtu ka bashkepunime me organizata dhe institucione te shumta nderkombetare nga vende te ndryshme si Franca, India, Turqia, Belgjika, Kroacia, Hungaria, Britania e Madhe, Hollanda, Rusia, etj. Ai u siguron studenteve praktika te shkelqyera dhe mundesi pune permes lidhjes. ups ajo eshte zhvilluar me firma te krijuara mire nder vite. <br><br> Me shume informata:<a target=\"_blank\" href=\"https://www.fu-berlin.de/en/index.html\">Faqja Kryesore</a>', 2, 'universiteti.php', 'Mesoni me shume');

